INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-curl_30_equip_12-15', 'Step 1', 'Stand with feet shoulder-width apart and hold dumbbells by your sides.', 'squat-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-curl_30_equip_12-15', 'Step 2', 'Squat down. Keep the weight in your heels, butt down and chest up.', 'squat-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-curl_30_equip_12-15', 'Step 3', 'Come up, squeezing your butt, and perform one arm curl at the top.', 'squat-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('crazy-ivan_120_equip_8-10', 'Step 1', 'Sit with knees bent and feet crossed. Lean back until your abs burn and hold the ball outside one hip.', 'crazy-ivan_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('crazy-ivan_120_equip_8-10', 'Step 2', 'Rotate through the upper body to bring the medicine ball up over the opposite shoulder, then down to the same hip, and repeat. Switch to the other side halfway through your time.', 'crazy-ivan_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('shoulder-press_60_equip_15-25', 'Step 1', 'Stand with feet hip-width apart and dumbbells by your sides.', 'shoulder-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('shoulder-press_60_equip_15-25', 'Step 2', 'Bring your arms up to your shoulders with elbows bent.', 'shoulder-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('shoulder-press_60_equip_15-25', 'Step 3', 'Raise your arms above your head, then lower down to your sides and repeat.', 'shoulder-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_60_equip_8', 'Step 1', 'Stand with your feet together and arms by your sides.', 'alt-lunge-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_60_equip_8', 'Step 2', 'Step one foot in front of you. Drive your hips down, pushing weight down through your front heel with your chest up and back flat.', 'alt-lunge-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_60_equip_8', 'Step 3', 'Step back to start position and bring dumbbells or hands above your head with palms facing in. Keep your abs tight and avoid arching your lower back.', 'alt-lunge-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_60_equip_8', 'Step 4', 'Bring your hands back down and repeat on the opposite side.', 'alt-lunge-press_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-10', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells by your sides.', 'squat-sumo-raise_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-10', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-raise_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-10', 'Step 3', 'Come back up, lifting your arms out to the side until they are parallel to the floor, and repeat.', 'squat-sumo-raise_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row_60', 'Step 1', 'Start in the plank position.', 'plank-row_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row_60', 'Step 2', 'Perform a row, bringing your elbow up past your back and keeping it close to your sides. Repeat with the other arm.', 'plank-row_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row_120_equip_8-10', 'Step 1', 'Start in the plank position with dumbbells in your hands.', 'plank-row_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row_120_equip_8-10', 'Step 2', 'Perform a row, bringing your elbow up past your back and keeping it close to your sides. Repeat with the other arm.', 'plank-row_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8', 'Step 1', 'Stand with feet hip-width apart and dumbbells by your sides.', 'single-leg-deadlift-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8', 'Step 2', 'Bend at the waist to bring chest parallel to the floor, raising one leg out behind you.', 'single-leg-deadlift-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8', 'Step 3', 'Come back up, swinging the raised leg forward. Bring dumbbells up to your shoulders, hinging at the elbows. Lower the arms and repeat on the same side.', 'single-leg-deadlift-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 1', 'Stand with your feet hip-width apart.', 'pushup-walk-swivel_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 2', 'Bring your hands to the floor.', 'pushup-walk-swivel_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 3', 'Walk your hands out until you reach a push up position.', 'pushup-walk-swivel_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 4', 'Perform one push up.', 'pushup-walk-swivel_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 5', 'Bring one knee up and twist to opposite elbow. Repeat swivel on the other side.', 'pushup-walk-swivel_5', 'standard', '100');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_120', 'Step 6', 'Walk hands back and return to start position. Repeat.', 'pushup-walk-swivel_6', 'standard', '120');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('med-ball-tricep-pushup_120_equip_med', 'Step 1', 'Start in the push up position with both hands on the ball below your chest.', 'med-ball-tricep-pushup_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('med-ball-tricep-pushup_120_equip_med', 'Step 2', 'Lower into a triceps push up, keeping abs tight and elbows close to your sides.', 'med-ball-tricep-pushup_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60', 'Step 1', 'Start in the plank position.', 'plank-row-rotation_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60', 'Step 2', 'Perform a row with one arm, bringing your elbow up past your back.', 'plank-row-rotation_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60', 'Step 3', 'Rotate to straighten the arm above your head, making a T shape. Keep your abs tight and quads contracted.', 'plank-row-rotation_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60', 'Step 4', 'Bring the arm down and repeat on the other side.', 'plank-row-rotation_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_ms_60_equip_med', 'Step 1', 'Start in push up position with the medicine ball under one hand.', 'alt-med-pushup_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_ms_60_equip_med', 'Step 2', 'Lower down as far as you can and push back up to start position.', 'alt-med-pushup_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_ms_60_equip_med', 'Step 3', 'Roll the ball to the other hand.', 'alt-med-pushup_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_ms_60_equip_med', 'Step 4', 'Repeat the push up on the other side.', 'alt-med-pushup_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_10-12', 'Step 1', 'Stand with feet hip-width apart and dumbbells by your sides.', 'single-leg-deadlift-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_10-12', 'Step 2', 'Bend at the waist to bring chest parallel to the floor, raising one leg out behind you.', 'single-leg-deadlift-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_10-12', 'Step 3', 'Come back up, swinging the raised leg forward. Bring dumbbells up to your shoulders, hinging at the elbows. Lower the arms and repeat on the same side.', 'single-leg-deadlift-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('stretch-quad-lying_120', 'Step 1', 'Sit on your butt and bring one foot behind you to feel the stretch in the front of your thigh.', 'stretch-quad-lying_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('stretch-quad-lying_120', 'Step 2', 'Lean back as far as you can. As your flexibility improves you will be able to go lower. Bend your straight leg towards your other leg to feel the stretch more. Switch sides halfway through.', 'stretch-quad-lying_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_120', 'Step 1', 'Start in a lunge position.', 'pulse-lunges_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_120', 'Step 2', 'Lower your body as low as you can so your back knee is just above the floor.', 'pulse-lunges_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_120', 'Step 3', 'Bring yourself up just halfway, then back down to the lowest position. Continue to pulse up and down, switching legs halfway through.', 'pulse-lunges_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-stepback_120_equip_8-10', 'Step 1', 'Stand with your feet close together, holding the dumbbells by your sides.', 'alt-lunge-stepback_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-stepback_120_equip_8-10', 'Step 2', 'Step backwards into a lunge, keeping the chest up and knees bent. Come back up and repeat with the other leg.', 'alt-lunge-stepback_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-side-med_60_equip_med', 'Step 1', 'Stand with feet close together, holding medicine ball to the side.', 'lunge-side-med_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-side-med_60_equip_med', 'Step 2', 'Take a big step out to the side and come down through the heel of the bent leg.', 'lunge-side-med_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-side-med_60_equip_med', 'Step 3', 'Still in the lunge, twist upper body to bring the ball outside the hip of the bent leg.', 'lunge-side-med_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-side-med_60_equip_med', 'Step 4', 'Return the ball to center and push back into start position. Halfway through your time, switch sides.', 'lunge-side-med_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('jog-light_60', 'Step 1', 'Lightly jog around your space, staying on the balls of your feet and swinging your arms.', 'jog-light', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-with-leg-lift_120', 'Step 1', 'Start in a plank position on your forearms, keeping your back flat and your weight over your shoulders.', 'plank-with-leg-lift_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-with-leg-lift_120', 'Step 2', 'Lift one foot off the floor so that it''s just hovering over the floor. Switch sides halfway through.', 'plank-with-leg-lift_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lateral-hops-place_60', 'Step 1', 'Start with feet close together in an athletic position, then squat.', 'lateral-hops-place_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lateral-hops-place_60', 'Step 2', 'Pushing off both feet evenly, jump side to side in a small motion.', 'lateral-hops-place_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('inch-worm-push_60', 'Step 1', 'Stand with your feet hip-width apart.', 'inch-worm-push_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('inch-worm-push_60', 'Step 2', 'Bring your hands to the floor, then walk them forward until you are in a push up position.', 'inch-worm-push_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('inch-worm-push_60', 'Step 3', 'Lower into a push up, then lift your hips and walk the feet up towards your hands.', 'inch-worm-push_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('inch-worm-push_60', 'Step 4', 'Without standing upright, walk the hands back out to repeat the movement.', 'inch-worm-push_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-curl_120_equip_8-10', 'Step 1', 'Stand with your feet together and dumbbells by your sides.', 'alt-lunge-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-curl_120_equip_8-10', 'Step 2', 'Step one foot in front of you. Drive your hips down, pushing weight down through your front heel with your chest up and back flat.', 'alt-lunge-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-curl_120_equip_8-10', 'Step 3', 'Step back to start position and bring the dumbbells up to your shoulders in an arm curl. Keep your abs tight.', 'alt-lunge-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-curl_120_equip_8-10', 'Step 4', 'Lower arms and repeat on the other side.', 'alt-lunge-curl_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 1', 'Start in the push up position with both hands below your chest.', 'burpee-mod_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 2', 'Step one foot up by the same hand.', 'burpee-mod_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 3', 'Step the other foot up, keeping hips low and chest up.', 'burpee-mod_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 4', 'Stand up.', 'burpee-mod_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 5', 'Squat back down so your hands touch the floor again.', 'burpee-mod_5', 'standard', '100');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('burpee-mod_60', 'Step 6', 'Step one foot back, then the other. Return to the push up position and repeat.', 'burpee-mod_6', 'standard', '120');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_60', 'Step 1', 'Lie on your stomach with legs straight and arms up by your head.', 'opp-superman_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_60', 'Step 2', 'Lift one arm and the opposite leg off the floor.', 'opp-superman_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_60', 'Step 3', 'Lower and repeat on the other side.', 'opp-superman_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-curl_ms_120', 'Step 1', 'Stand with arms by your sides and a slight bend at the knee.', 'single-leg-curl_1', 'standard', '20');
