INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_30_equip_med', 'Step 1', 'Stand with feet hip-width apart, holding the medicine ball.', 'ski-med_1', 'standard', '20');
