INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dead-lift_60_equip_15-25', 'Step 1', 'Stand with feet hip-width apart, holding the dumbbells in front of your legs.', 'dead-lift_1', 'standard', '20');
