INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-walk-swivel_60', 'Step 1', 'Stand with your feet hip-width apart.', 'pushup-walk-swivel_1', 'standard', '20');
