INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-walk_120_equip_8-10', 'Step 1', 'Stand with your feet hip-width apart.', 'lunge-walk_1', 'standard', '20');
