INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('jump-wood-chops_60', 'Step 1', 'Stand with feet together and hands together in front of you.', 'jump-wood-chops_1', 'standard', '20');
