INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('jump-wood-chops_60', 'Step 4', 'Jump back to squat position and lower arms between your legs, and repeat.', 'jump-wood-chops_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('lunge-world_120', 'Step 1', 'Stand with your feet shoulder-width apart.', 'lunge-world_1', 'standard', '20');
