INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('two-feet-plank-side-hops_60', 'Step 1', 'Start in a push up position.', 'two-feet-plank-side-hops_1', 'standard', '20');
