INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('two-feet-plank-side-hops_60', 'Step 3', 'Jump back to start position.', 'two-feet-plank-side-hops_3', 'standard', '60');
