INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('russian-twists_15_equip_10', 'Step 1', 'Sit with knees bent and feet crossed. Lean back until your abs burn. Hold medicine ball to your chest.', 'russian-twists_1', 'standard', '20');
