INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_15', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells up by your shoulders.', 'squat-sumo-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_15', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_15', 'Step 3', 'Come back up, squeezing your butt and legs, and press the dumbbells up above your head. Repeat.', 'squat-sumo-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('hip-lift_60', 'Step 1', 'Lie on your back with knees bent and heels below your knees.', 'hip-lift_1', 'standard', '20');
