INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_10-15', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells up by your shoulders.', 'squat-sumo-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_10-15', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_10-15', 'Step 3', 'Come back up, squeezing your butt and legs, and press the dumbbells up above your head. Repeat.', 'squat-sumo-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('crazy-ivan_120_equip_10', 'Step 1', 'Sit with knees bent and feet crossed. Lean back until your abs burn and hold the ball outside one hip.', 'crazy-ivan_1', 'standard', '20');
