INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-fly_120', 'Step 1', 'Stand with feet hip-width apart and arms by your sides.', 'single-leg-deadlift-fly_1', 'standard', '20');
