INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-row_120_equip_8', 'Step 1', 'Stand with feet hip-width apart and dumbbells by your sides.', 'single-leg-deadlift-row_equip_1', 'standard', '20');
