INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row_60_equip_12-20', 'Step 1', 'Start in the plank position with dumbbells in your hands.', 'plank-row_1', 'standard', '20');
