INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_60_equip_5-8', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells by your sides.', 'squat-sumo-raise_1', 'standard', '20');
