INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_120_equip_8-12', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells up by your shoulders.', 'squat-sumo-press_1', 'standard', '20');
