INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('mountain-climbers_60', 'Step 3', 'Swap your feet back and forward as fast as you can, without losing form.', 'mountain-climbers_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_120_equip_med', 'Step 1', 'Stand with feet hip-width apart, holding the medicine ball.', 'ski-med_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_120_equip_med', 'Step 2', 'Drop low in the hips, raise your right foot and bring it behind the left leg.', 'ski-med_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_120_equip_med', 'Step 3', 'Take a wide jump to the right.', 'ski-med_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_120_equip_med', 'Step 4', 'Land with the right leg in front and the left leg crossed behind it.', 'ski-med_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('ski-med_120_equip_med', 'Step 5', 'Repeat, jumping back and forth.', 'ski-med_5', 'standard', '100');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('toe-touch_15_equip_med', 'Step 1', 'Lie on your back, holding the medicine ball above your chest with arms straight and legs straight up in the air.', 'toe-touch_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('toe-touch_15_equip_med', 'Step 2', 'Using your abs, reach towards your toes with the ball. Return to start position and repeat.', 'toe-touch_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_60', 'Step 1', 'Stand with arms by your sides and a slight bend at the knee.', 'single-leg-deadlift-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_60', 'Step 2', 'Lift one leg, bending at the knee, and balance on the other foot.', 'single-leg-deadlift-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_60', 'Step 3', 'Hinge from the elbows to bring arms up to your shoulders. Lower and repeat, switching legs halfway through your time.', 'single-leg-deadlift-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-downs_60', 'Step 1', 'Lie on your back with legs straight up in the air, 90 degrees from your body.', 'kick-downs_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-downs_60', 'Step 2', 'Keeping your legs straight, lower them as far as you can. Return to start position, keeping your belly button drawn in the whole time.', 'kick-downs_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_30', 'Step 1', 'Lie on your stomach with legs straight and arms up by your head.', 'opp-superman_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_30', 'Step 2', 'Lift one arm and the opposite leg off the floor.', 'opp-superman_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('opp-superman_30', 'Step 3', 'Lower and repeat on the other side.', 'opp-superman_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-flips_60', 'Step 1', 'Stand with feet shoulder-width apart and hands by your sides.', 'squat-flips_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-flips_60', 'Step 2', 'Squat down. Keep the weight in your heels, butt down and chest up.', 'squat-flips_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-flips_60', 'Step 3', 'Spring up from your heels and jump into a 180-degree turn.', 'squat-flips_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-flips_60', 'Step 4', 'Land in a squat facing the other way and repeat from here.', 'squat-flips_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-clock-squats_60', 'Step 1', 'Stand on one leg and hold hands together in front of you.', 'single-leg-clock-squats_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-clock-squats_60', 'Step 2', 'Bend at the hip and knee to squat down low and bring your hands to the floor at a 10 o''clock position.', 'single-leg-clock-squats_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-clock-squats_60', 'Step 3', 'Stand back up.', 'single-leg-clock-squats_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-clock-squats_60', 'Step 4', 'Keep squatting down and bringing hands down to 11, 12, 1, and 2 o''clock positions, standing up between each one. Switch legs halfway through.', 'single-leg-clock-squats_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-jump_15_equip_15', 'Step 1', 'Squat with feet shoulder-width apart.', 'squat-jump_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-jump_15_equip_15', 'Step 2', 'Jump up, raising your hands up in the air.', 'squat-jump_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-jump_15_equip_15', 'Step 3', 'Land softly in the squat and repeat.', 'squat-jump_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8-10', 'Step 1', 'Stand with feet hip-width apart and dumbbells by your sides.', 'single-leg-deadlift-curl_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8-10', 'Step 2', 'Bend at the waist to bring chest parallel to the floor, raising one leg out behind you.', 'single-leg-deadlift-curl_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('single-leg-deadlift-curl_120_equip_8-10', 'Step 3', 'Come back up, swinging the raised leg forward. Bring dumbbells up to your shoulders, hinging at the elbows. Lower the arms and repeat on the same side.', 'single-leg-deadlift-curl_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('cobra-plank_60', 'Step 1', 'Lie on your stomach with arms and legs straight out, and feet flexed.', 'cobra-plank_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('cobra-plank_60', 'Step 2', 'Lift arms and legs off the floor as high as you can, keeping them straight.', 'cobra-plank_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('cobra-plank_60', 'Step 3', 'Bring your feet down and your palms to the floor outside your chest.', 'cobra-plank_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('cobra-plank_60', 'Step 4', 'Push up, keeping your back straight, abs tight and butt down.', 'cobra-plank_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('side-plank-crunches_120', 'Step 1', 'Lying on your side with one hand directly under your shoulder and your feet stacked on top of each other, lift your hips up to a level plank.', 'side-plank-crunches_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('side-plank-crunches_120', 'Step 2', 'Contract your abs to lift the hips higher.', 'side-plank-crunches_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('side-plank-crunches_120', 'Step 3', 'Lower hips back down to level plank. Continue lifting and lowering the hips, switching sides halfway through.', 'side-plank-crunches_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-straight_120', 'Step 1', 'Stand with feet hip-width apart.', 'kick-straight_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-straight_120', 'Step 2', 'Kick one leg straight in front of you, while reaching for the foot with your opposite hand.', 'kick-straight_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-straight_120', 'Step 3', 'Lower that leg while stepping forward, and then kick up the opposite leg to repeat.', 'kick-straight_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_12-20', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells up by your shoulders.', 'squat-sumo-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_12-20', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_12-20', 'Step 3', 'Come back up, squeezing your butt and legs, and press the dumbbells up above your head. Repeat.', 'squat-sumo-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat_60_equip_8', 'Step 1', 'Stand with feet shoulder-width apart and dumbbells by your sides.', 'squat_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat_60_equip_8', 'Step 2', 'Squat down so thighs are parallel to the floor. Keep the weight in your heels, chest up and back flat.', 'squat_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat_60_equip_8', 'Step 3', 'Squeeze your butt as you come up. Repeat.', 'squat_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-side_120', 'Step 1', 'Lie on one side with forearm and elbow supporting your upper body, legs straight. Lift your hips off the floor to align shoulder, hips and knee. Switch sides halfway through your time.', 'plank-side', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_60_equip_15-25', 'Step 1', 'Stand with feet shoulder-width apart, holding one dumbell with both hands out in front of you.', 'wood-chop_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_60_equip_15-25', 'Step 2', 'Squat down to the floor, swinging the dumbell between your legs.', 'wood-chop_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_60_equip_15-25', 'Step 3', 'Come up from the squat, swinging the dumbell above your head. Repeat.', 'wood-chop_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-15', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells by your sides.', 'squat-sumo-raise_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-15', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-raise_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-raise_120_equip_8-15', 'Step 3', 'Come back up, lifting your arms out to the side until they are parallel to the floor, and repeat.', 'squat-sumo-raise_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-downs_30', 'Step 1', 'Lie on your back with legs straight up in the air, 90 degrees from your body.', 'kick-downs_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('kick-downs_30', 'Step 2', 'Keeping your legs straight, lower them as far as you can. Return to start position, keeping your belly button drawn in the whole time.', 'kick-downs_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_120_equip_8-12', 'Step 1', 'Stand with your feet together and arms by your sides.', 'alt-lunge-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_120_equip_8-12', 'Step 2', 'Step one foot in front of you. Drive your hips down, pushing weight down through your front heel with your chest up and back flat.', 'alt-lunge-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_120_equip_8-12', 'Step 3', 'Step back to start position and bring dumbbells or hands above your head with palms facing in. Keep your abs tight and avoid arching your lower back.', 'alt-lunge-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-press_120_equip_8-12', 'Step 4', 'Bring your hands back down and repeat on the opposite side.', 'alt-lunge-press_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('push-away-balance_120', 'Step 1', 'Stand balancing on the right leg.', 'push-away-balance_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('push-away-balance_120', 'Step 2', 'Squat down while leaning forward and place both hands on the floor.', 'push-away-balance_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('push-away-balance_120', 'Step 3', 'Use your abs to push yourself back into the upright position. Repeat on the same leg, switching sides halfway through your time.', 'push-away-balance_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_120_equip_10-15', 'Step 1', 'Stand with feet shoulder-width apart, holding one dumbell with both hands out in front of you.', 'wood-chop_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_120_equip_10-15', 'Step 2', 'Squat down to the floor, swinging the dumbell between your legs.', 'wood-chop_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('wood-chop_120_equip_10-15', 'Step 3', 'Come up from the squat, swinging the dumbell above your head. Repeat.', 'wood-chop_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_120_equip_med', 'Step 1', 'Start in push up position with the medicine ball under one hand.', 'alt-med-pushup_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_120_equip_med', 'Step 2', 'Lower down as far as you can and push back up to start position.', 'alt-med-pushup_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_120_equip_med', 'Step 3', 'Roll the ball to the other hand.', 'alt-med-pushup_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_120_equip_med', 'Step 4', 'Repeat the push up on the other side.', 'alt-med-pushup_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dead-lift_60_equip_15-20', 'Step 1', 'Stand with feet hip-width apart, holding the dumbbells in front of your legs.', 'dead-lift_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dead-lift_60_equip_15-20', 'Step 2', 'Keeping a slight bend in the knees, bend from the waist to bring your chest parallel to the floor.', 'dead-lift_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dead-lift_60_equip_15-20', 'Step 3', 'Return to standing position, squeezing your butt as you come up.', 'dead-lift_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('fwdback-hops_30', 'Step 1', 'Stand with feet hip-width apart. Bend knees and come up onto the balls of your feet.', 'fwdback-hops_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('fwdback-hops_30', 'Step 2', 'Jump forward and backward in a quick, small movement.', 'fwdback-hops_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dips-straight-leg_60', 'Step 1', 'Sit with your back to the step or bench, legs straight and feet on the floor. Grip the edge with knuckles facing forward and hands shoulder-width apart.', 'dips-straight-leg_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('dips-straight-leg_60', 'Step 2', 'Keeping legs straight, lower your body down, bending elbows into a 90-degree angle. Push back up and repeat.', 'dips-straight-leg_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-hold_60', 'Step 1', 'Stand with feet shoulder-width apart.', 'squat-hold_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-hold_60', 'Step 2', 'Squat down so thighs are parallel to the floor. Hold position, keeping back flat and chest up.', 'squat-hold_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-plank-row_ms_60_equip_3-5', 'Step 1', 'Start in the push up position with dumbbells in your hands', 'pushup-plank-row_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-plank-row_ms_60_equip_3-5', 'Step 2', 'Lower your body towards the floor.', 'pushup-plank-row_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pushup-plank-row_ms_60_equip_3-5', 'Step 3', 'Push up. Bring one arm back into a row, bringing the elbow up behind you. Then repeat with the other arm.', 'pushup-plank-row_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_120', 'Step 1', 'Start in the plank position.', 'plank-row-rotation_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_120', 'Step 2', 'Perform a row with one arm, bringing your elbow up past your back.', 'plank-row-rotation_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_120', 'Step 3', 'Rotate to straighten the arm above your head, making a T shape. Keep your abs tight and quads contracted.', 'plank-row-rotation_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_120', 'Step 4', 'Bring the arm down and repeat on the other side.', 'plank-row-rotation_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_8-10', 'Step 1', 'Stand with feet wide, toes turned out, holding dumbbells up by your shoulders.', 'squat-sumo-press_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_8-10', 'Step 2', 'Squat the hips down towards the floor.', 'squat-sumo-press_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('squat-sumo-press_60_equip_8-10', 'Step 3', 'Come back up, squeezing your butt and legs, and press the dumbbells up above your head. Repeat.', 'squat-sumo-press_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60_equip_10-15', 'Step 1', 'Start in the plank position with dumbbells in your hands.', 'plank-row-rotation_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60_equip_10-15', 'Step 2', 'Perform a row with one arm, bringing your elbow up past your back.', 'plank-row-rotation_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60_equip_10-15', 'Step 3', 'Rotate to straighten the arm above your head, making a T shape. Keep your abs tight and quads contracted.', 'plank-row-rotation_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-row-rotation_60_equip_10-15', 'Step 4', 'Bring the arm down and repeat on the other side.', 'plank-row-rotation_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-walks_ms_60', 'Step 1', 'Start in the plank position with abs tight.', 'plank-walks_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-walks_ms_60', 'Step 2', 'Bend one arm to bring the elbow and forearm to the floor.', 'plank-walks_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-walks_ms_60', 'Step 3', 'Bring other arm down.', 'plank-walks_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('plank-walks_ms_60', 'Step 4', 'Push back up to start position and repeat on the other side.', 'plank-walks_4', 'standard', '80');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_60', 'Step 1', 'Start in a lunge position.', 'pulse-lunges_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_60', 'Step 2', 'Lower your body as low as you can so your back knee is just above the floor.', 'pulse-lunges_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('pulse-lunges_60', 'Step 3', 'Bring yourself up just halfway, then back down to the lowest position. Continue to pulse up and down, switching legs halfway through.', 'pulse-lunges_3', 'standard', '60');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-stepback_120_equip_10-12', 'Step 1', 'Stand with your feet close together, holding the dumbbells by your sides.', 'alt-lunge-stepback_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-lunge-stepback_120_equip_10-12', 'Step 2', 'Step backwards into a lunge, keeping the chest up and knees bent. Come back up and repeat with the other leg.', 'alt-lunge-stepback_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_60_equip_med', 'Step 1', 'Start in push up position with the medicine ball under one hand.', 'alt-med-pushup_1', 'standard', '20');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_60_equip_med', 'Step 2', 'Lower down as far as you can and push back up to start position.', 'alt-med-pushup_2', 'standard', '40');
INSERT INTO exercise_pages (exercise_name, title, instructions, background_image, archive, sort_order) VALUES ('alt-med-pushup_60_equip_med', 'Step 3', 'Roll the ball to the other hand.', 'alt-med-pushup_3', 'standard', '60');
